const Nav = () => {
    return (
        <nav className="sidebar">
            <div> <a href="#">Profile</a> </div>
            <div> <a href="#">News</a> </div>
            <div> <a href="#">Music</a> </div>
            <div> <a href="#">Post</a> </div>
            <div> <a href="#" style={"line-height: 2em"}>Setting</a> </div>
        </nav>
    );
}

export default Nav;
